const Card = ({ card, hideCard }) => {
    return (
        <div className="card">
            {card}
            <NotPlayable id="hide_1" hideCard={true}/>
        </div>
    )
}

Card.propTypes = {
    card: PropTypes.oneOfType([
        PropTypes.number,
        PropTypes.oneOf([' '])
    ]).isRequired
};

export default Card;
